        argamassa: argamassa,
        tipo_acabamento: tipo_acabamento,
        cor_tinta: cor_tinta,
    }
    const responseGeral = await axios.put(`${base_url}/update/project`, todoGeral);

    /** Preenchimento de quantidades e custos */

